INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-10-06 07:46:52',41,74,624.05,3,'Me de virtute misisti. Sed ex eo est consecutus? -- Laudem et caritatem, quae sunt vitae sine metu.','Esse numquam potest. Praeterea bona praeterita non meminerunt, praesentibus non fruuntur, futura modo expectant, quae quia certa esse non possunt et, si essent vera, nihil afferrent, quo iucundius, id est in voluptate. Neque enim disputari sine reprehensione nec cum iracundia aut pertinacia recte disputari potest. Sed ad rem redeamus; de hominibus dici non necesse est. Tribus.','Sine cura metuque vivamus animumque et corpus, quantum efficere possimus, molestia liberemus. Ut enim aeque doleamus animo, cum corpore dolemus, fieri tamen permagna accessio potest, si aliquod aeternum et infinitum impendere malum nobis opinemur. Quod idem licet transferre in voluptatem, ut postea variari voluptas distinguique possit, augeri amplificarique non possit. At etiam Athenis, ut e patre.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-10-11 12:12:03',42,98,418.37,1,'Praesenti nec expectata voluptate, quid eo miserius dici aut fingi potest? Quodsi vita doloribus referta.','Disciplinam probant, non soleat accuratius explicari; verum.','Re mihi non aeque satisfacit, et quidem tibi et declinationem istam atomorum et magnitudinem solis probabo et Democriti errata ab Epicuro sapiens semper beatus inducitur: finitas.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-09-23 03:45:51',43,21,577.66,5,'Inmortalibus supplicii causa importari putant. Quae autem inanes.','Vos arbitrer, sed ut ratione et via procedat oratio. Quaerimus.','Ita paratus est, ut necessariae nec opera multa nec impensa expleantur; ne naturales quidem multa desiderant, propterea quod ipsa natura, ut ait ille, sciscat et probet, id est vel summum bonorum vel ultimum vel extremum -- quod et acutum genus est et ad usus.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-07-02 13:50:14',44,31,579.45,4,'Sin, ut dolore suo sanciret militaris imperii disciplinam exercitumque in gravissimo bello animadversionis metu contineret.','Dicturam pater aiebat, si loqui posset. Conclusum est enim contra Cyrenaicos satis acute, nihil ad.','Tria vix amicorum paria reperiuntur, ut ad Orestem pervenias profectus a Theseo. At vero Epicurus una in domo, et ea quidem angusta, quam magnos quantaque amoris conspiratione consentientis tenuit amicorum greges! Quod fit etiam nunc ab Epicureis. Sed ad rem redeamus; de hominibus dici non necesse est. Tribus igitur modis video esse.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2023-12-26 23:00:06',45,44,402.63,5,'Cum idem fabellas Latinas ad verbum e Graecis expressas non inviti legant. Quis enim tam inimicus paene nomini.','Placet: constituam, quid et quale sit id, de quo quaerimus, non quo modo efficiatur concludaturque ratio tradit, non qua via captiosa solvantur ambigua distinguantur ostendit; iudicia rerum in sensibus ponit, quibus si semel aliquid falsi pro vero probatum sit, sublatum esse omne iudicium veri.','Qua intellegebat contineri suam. Atque haec ratio late patet. In quo enim maxime consuevit iactare vestra se oratio, tua praesertim, qui studiose antiqua persequeris, claris et fortibus viris commemorandis eorumque factis non emolumento aliquo, sed ipsius.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-02-26 23:08:38',46,91,602.60,2,'Cogitemus; infinitio ipsa, quam apeirian vocant, tota ab illo inventore veritatis et quasi involuta aperiri, altera prompta et aperta iudicari. Etenim quoniam detractis de homine sensibus reliqui nihil est, necesse est, non satis politus iis artibus, quas qui tenent, eruditi appellantur -- aut ne deterruisset alios a studiis. Quamquam te quidem video minime esse deterritum. Quae.','Audivi, cum miraretur ille quidem utrumque, Phaedrum autem etiam amatoriis levitatibus dediti, alii petulantes, alii audaces, protervi, idem intemperantes et ignavi, numquam in sententia permanentes, quas ob causas in eorum vita nulla est intercapedo molestiae. Igitur neque stultorum quisquam beatus neque sapientium non beatus.','Nihil asperum nisi dolorem, de quibus et ab Epicuro scriptum est et ab antiquis, ad arbitrium suum scribere? Quodsi Graeci leguntur a Graecis isdem de rebus alia ratione compositis, quid est, quod nullam eruditionem esse duxit, nisi quae beatae vitae disciplinam iuvaret. An ille.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-05-14 08:17:32',47,6,377.84,4,'Quid in omni re doloris amotio successionem efficit voluptatis. Itaque non placuit Epicuro medium esse quiddam inter dolorem et voluptatem.','Nisi voluptatem, nihil asperum nisi dolorem, de quibus ante dictum est, sic.','Malit quam deserere ullam officii partem, ad ea, quae dices.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-07-25 10:36:54',48,47,572.11,3,'Nollem me ab eo nos abducat? Sin laboramus, quis est, qui dolorem eum fugiat, quo voluptas nulla pariatur? At vero eos et accusamus et iusto odio dignissimos ducimus, qui blanditiis praesentium voluptatum deleniti atque corrupti, quos dolores et quas molestias excepturi sint, obcaecati cupiditate non provident, similique sunt in eadem causa sunt, qua ante quam nati.','Ad Epicurum. Nam si dicent ab illis has res esse tractatas, ne ipsos quidem Graecos est cur verear, ne ad eam non possim accommodare Torquatos nostros? Quos tu paulo ante collegi, abest.','Universas familias evertunt, totam etiam labefactant saepe rem publicam. Ex cupiditatibus odia, discidia, discordiae, seditiones, bella nascuntur, nec eae se foris solum iactant nec tantum in alios caeco impetu incurrunt.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-11-11 14:59:33',49,25,580.34,4,'Atque integre iudicante. Itaque negat opus.','Historiae cognitioque rerum, quid poetarum evolutio, quid tanta tot versuum memoria voluptatis affert? Nec mihi illud dixeris: ''Haec enim ipsa mihi sunt voluptati, et.','Et accurate disserendum et rationibus conquisitis de voluptate et dolore magnam aliquam quaerat voluptatem. Ut enim aeque doleamus animo, cum corpore.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-04-13 14:00:28',50,65,476.93,5,'Cupiditatum generibusque earum explicatis, et, ut modo docui, cognitionis regula et.','Fortitudo quidem, sed ista sequimur, ut sine cura metuque vivamus.','Desiderabile concupiscunt, plusque in ipsa iniuria detrimenti est quam in iis rebus emolumenti, quae pariuntur iniuria. Itaque ne iustitiam quidem recte quis dixerit per se laetitiam, id est voluptatem. Homines.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-04-22 00:27:23',51,20,533.27,5,'Stultorum vitam cum sua comparat, magna afficitur voluptate. Dolores autem si qui e nostris aliter existimant, quos quidem video esse.','Et rerum gerendarum. Sic e physicis et fortitudo.','Etiam legum iudiciorumque poenis obligantur. Qui autem ita frui volunt voluptatibus, ut nulli propter eas consequantur dolores, et qui suum iudicium retinent, ne voluptate victi faciant id, quod his libris quaeritur, qui sit finis, quid extremum, quid ultimum, quo sint omnia bene vivendi recteque faciendi consilia referenda, quid.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-01-16 06:38:10',52,36,449.40,4,'Vita nulla est intercapedo molestiae. Igitur neque stultorum quisquam beatus neque sapientium non beatus. Multoque hoc melius nos veriusque quam.','Placeat, facere possimus, omnis voluptas assumenda est, omnis dolor repellendus.','Dolor forte successerit, at contra gaudere nosmet omittendis doloribus, etiamsi voluptas ea, quae hoc non minus declarant, sed videntur leviora, veniamus. Quid tibi, Torquate.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-01-08 07:40:01',53,26,534.07,4,'Disciplinam probant, non soleat accuratius explicari; verum enim invenire volumus, non tamquam adversarium aliquem convincere. Accurate autem quondam a L. Torquato, homine omni doctrina erudito, defensa est Epicuri sententia de voluptate, nihil scilicet novi, ea tamen, quae te ipsum probaturum esse confidam. Certe, inquam.','Cum in rerum natura duo quaerenda sint, unum, quae materia sit, ex qua quaeque res efficiatur, alterum, quae naturales essent nec tamen id, cuius causa haec finxerat, assecutus est. Nam si omnes veri erunt, ut Epicuri ratio docet, tum denique poterit aliquid cognosci et.','Quaeque cernantur, omnia, eumque motum atomorum nullo a principio, sed ex aeterno tempore intellegi convenire. Epicurus autem, in quibus nulla solida utilitas omnisque puerilis.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-01-14 19:04:25',54,38,541.74,2,'Sed potius inflammat, ut coercendi magis quam dedocendi esse videantur. Invitat igitur vera ratio bene sanos ad iustitiam, aequitatem, fidem.','Perfruique maximis et animi et molestiam dolor afferat, eorum tamen utrumque et ortum esse e corpore et ad tranquillitatem ferant, quid est enim in.','Aristoteli, Theophrasti orationis ornamenta neglexerit. Nam illud quidem physici.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-06-11 00:37:32',55,75,378.05,2,'Morbi sunt cupiditates inmensae et inanes.','Centurionum, praeclarorum hominum ac primorum signiferumque, maluisti dici. Graece ergo praetor Athenis.','Tamen et dignitatis esse negent. Contra quos omnis dicendum breviter.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2023-12-25 18:12:34',56,6,506.70,4,'Quadam placet ac leniat. Temperantia est enim, quae in rebus aut.','Quam deserere ullam officii partem, ad ea, quae senserit ille, tibi non vera videantur. Vide, quantum, inquam, fallare.','Sine causa? Quae fuerit causa, mox videro; interea hoc.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-02-13 14:01:00',66,77,529.60,5,'Aegritudine possit et sine metu degendae praesidia firmissima. -- Filium morte multavit.','Oratio nostra omnem sibi fidem sensibus confirmat, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio, cumque.','Nobis probaretur, sed etiam spe eriguntur consequentis ac posteri temporis. Quod quia nullo modo sine amicitia firmam et perpetuam iucunditatem vitae tenere possumus neque vero ipsam amicitiam tueri.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-08-05 02:03:22',57,86,579.14,1,'Sed in his rebus peccant, cum e quibus haec efficiantur ignorant. Animi autem morbi sunt cupiditates inmensae et inanes divitiarum, gloriae, dominationis, libidinosarum etiam voluptatum. Accedunt aegritudines, molestiae, maerores, qui exedunt animos conficiuntque curis hominum non intellegentium nihil dolendum esse.','In sanguinem suum tam crudelis fuisse, nihil ut de utilitatibus, nihil ut de omni virtute sit dictum. Sed similia fere dici possunt. Ut enim aeque doleamus animo, cum corpore dolemus.','Tamen in quibusdam neque pecuniae modus est neque honoris neque imperii nec libidinum nec epularum nec reliquarum cupiditatum, quas nulla praeda umquam improbe parta minuit, sed potius inflammat, ut coercendi magis quam dedocendi esse videantur. Invitat igitur vera ratio bene sanos in viam placatae.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-04-25 17:47:13',58,30,607.76,2,'Ut eum Macedonum legatis accusantibus, quod pecunias praetorem in provincia cepisse arguerent, causam apud se dicere iuberet reque ex utraque parte audita pronuntiaret eum non talem videri fuisse.','Inermis ac nudus est. Tollit definitiones, nihil de dividendo ac partiendo docet, non quo ignorare vos arbitrer, sed ut ratione et via procedat oratio. Quaerimus igitur, quid sit extremum et ultimum bonorum, quod omnium philosophorum sententia tale debet esse, ut ad id autem res referuntur omnes, fatendum est summum esse bonum iucunde vivere. Id qui in.','Et moribus comprobavit. Quod quam magnum sit fictae veterum fabulae declarant, in.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-11-27 04:40:13',59,54,381.01,5,'Vituperata ab Hortensio. Qui liber cum et tibi probatus videretur et iis, quos ego posse iudicare arbitrarer, plura suscepi veritus ne movere hominum studia viderer, retinere non posse. Qui autem, si maxime hoc placeat, moderatius tamen.','Dolore et molestia perfruique maximis et animi et corporis voluptatibus, videtisne quam nihil molestiae consequatur, vel illum, qui dolorem ipsum, quia dolor sit, amet, consectetur, adipisci velit, sed quia consequuntur magni dolores eos, qui ratione voluptatem sequi nesciunt, neque porro quisquam est, qui dolorem eum fugiat, quo voluptas.','Petulantes, alii audaces, protervi, idem intemperantes et ignavi, numquam in sententia permanentes, quas ob causas in eorum vita nulla est intercapedo molestiae. Igitur neque stultorum quisquam beatus neque sapientium non beatus. Multoque.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2023-12-27 23:54:59',60,93,606.05,2,'P. Scaevolam M''.que Manilium, ab iisque M. Brutus dissentiet -- quod Graeci telos nominant --, quod ipsum nullam ad aliam rem, ad id autem res referuntur omnes, fatendum est summum esse bonum quicquam nisi nescio quam illam umbram, quod appellant honestum non tam id.','Inquit, sic agam, ut ipsi auctori huius disciplinae placet: constituam, quid et quale sit id, de quo Lucilius: ''ferreum scriptorem'', verum, opinor, scriptorem tamen.','Parentes, multi amicos, non nulli patriam, plerique autem se ipsos amentur. Etenim si delectamur.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-02-16 17:57:46',61,26,490.10,5,'Depulsa est, ipsa detractio molestiae consecutionem affert voluptatis, sic in.','Quod Epicurum nostrum non tu quidem oderis, ut fere faciunt, qui ab eo nos abducat? Sin laboramus, quis est, qui Ennii Medeam aut Antiopam Pacuvii spernat aut reiciat, quod se isdem Euripidis fabulis delectari dicat, Latinas litteras oderit? Synephebos ego, inquit, potius Caecilii aut Andriam Terentii quam utramque Menandri legam? A quibus tantum dissentio, ut, cum.','Quo non plus voluptatum habeat quam dolorum. Nam et.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-04-26 20:23:54',62,89,556.51,2,'Sit, exquirere? An, partus ancillae sitne in fructu habendus, disseretur inter principes civitatis, P. Scaevolam M''.que Manilium, ab iisque vitiis, quae paulo ante collegi, abest plurimum et.','Erit affectus erga amicum, quo in se ipsum, quosque labores.','Nihil aliud sit nisi cum voluptate vivere. Nec enim.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-01-03 20:38:27',63,94,438.49,2,'Altera philosophiae parte. Quae est quaerendi ac disserendi, quae logikh dicitur, iste vester plane, ut mihi quidem videtur.','Coercendi magis quam dedocendi esse videantur.','Disputandum putant. Sed ut iis bonis erigimur, quae expectamus, sic laetamur iis, quae.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-09-10 22:46:17',66,13,483.99,3,'Utens nihil quieti videre, nihil tranquilli potest. Quodsi vitam omnem perturbari videmus errore et inscientia, sapientiamque esse solam, quae nos exhorrescere.','Qua etiam carere possent sine dolore tum in dedecora incurrunt, saepe etiam legum iudiciorumque poenis obligantur. Qui autem ita frui volunt voluptatibus, ut nulli propter eas consequantur dolores, et qui.','Magis animi morbis impediri necesse est! Animi autem voluptates et dolores animi quam.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-06-10 05:49:34',64,68,559.45,5,'Exquisitis rationibus confirmare, tantum satis esse admonere. Interesse enim inter argumentum conclusionemque rationis et inter mediocrem animadversionem atque admonitionem. Altera occulta quaedam et horrida, de malis Graecis Latine scripta deterius. Quibus ego assentior, dum modo de isdem rebus ne.','Cum ea non placeat, tamquam e theatro exeamus. Quibus rebus.','Et in conspectum suum venire vetuit, numquid tibi videtur de voluptatibus suis cogitavisse? Sed ut iis bonis erigimur, quae expectamus, sic laetamur iis, quae recordamur. Stulti autem malorum memoria torquentur.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-01-31 05:28:03',65,28,452.43,3,'Probabo, inquit, modo ista sis aequitate, quam ostendis. Sed uti oratione perpetua malo quam interrogare aut interrogari. Ut placet, inquam. Tum dicere exorsus est. Primum igitur.','Iis bonis erigimur, quae expectamus, sic laetamur iis, quae et splendide dicta sint neque sint conversa de Graecis? Nam si concederetur, etiamsi ad corpus nihil referatur.','Fuisse. Fieri, inquam, Triari, nullo pacto potest, ut non plus voluptatum habeat quam dolorum.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-03-18 20:27:10',66,42,385.77,5,'Inquam, nisi te audire vellem, censes haec dicturum fuisse? Utrum igitur percurri omnem Epicuri disciplinam placet an de.','In reque eo meliore, quo maior sit.','Te ipsum probaturum esse confidam. Certe, inquam, pertinax non ero tibique, si mihi probabis ea, quae voluptaria, delicata, mollis habeatur.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2023-12-03 14:07:57',67,11,623.24,3,'Magis quam dedocendi esse videantur. Invitat igitur vera ratio bene sanos in viam placatae, tranquillae, quietae, beatae vitae disciplinam iuvaret.','Tractatos? Quid? Epicurei num desistunt de isdem, de quibus neque depravate iudicant neque corrupte, nonne ei maximam gratiam habere debemus, qui hac exaudita quasi voce naturae sic eam firme graviterque comprehenderit, ut omnes bene sanos ad iustitiam, aequitatem, fidem, neque homini infanti aut inpotenti iniuste facta conducunt, qui nec facile efficere possit.','Ii voluptatem maximam adipiscuntur praetermittenda voluptate. Idem etiam dolorem saepe perpetiuntur, ne, si amicitiam propter nostram voluptatem expetendam putemus, tota amicitia quasi claudicare videatur.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-02-21 10:32:39',68,57,506.81,3,'Aliquo, sed ipsius honestatis decore laudandis, id totum evertitur eo delectu rerum, quem modo dixi, constituto, ut aut.','Hausta e fonte naturae, si tota oratio nostra omnem sibi fidem sensibus confirmat, id est corpora individua propter soliditatem, censet in infinito inani, in.','Mediocritatem desiderent. Sive enim ad minima veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in longinquitate levis, in gravitate brevis soleat esse, ut.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-02-23 12:24:47',69,94,497.75,5,'Contentam. Sed possunt haec quadam ratione dici non necesse est. Tribus igitur modis video.','Iis servire, qui vel utrisque litteris uti velint vel, si suas habent, illas non magnopere desiderent. Qui autem.','Id apte fieri possit, ut ab ipsis, qui eam disciplinam probant, non soleat accuratius explicari; verum enim invenire volumus, non tamquam adversarium aliquem convincere.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-01-20 22:46:38',70,36,515.00,2,'Imbutus quietus esse numquam potest. Praeterea bona praeterita grata recordatione renovata delectant. Est autem situm in nobis ut et adversa quasi perpetua oblivione obruamus et secunda iucunde ac suaviter meminerimus. Sed cum.','Aetatis percipi posse, quam ex hoc facillime perspici potest: Constituamus aliquem magnis, multis, perpetuis fruentem et animo et corpore voluptatibus nullo dolore nec impediente nec inpendente, quem tandem hoc statu praestabiliorem aut magis expetendum possimus dicere? Inesse enim necesse est aut in.','Fugiendam inprobitatem putamus, sed multo magis vita et factis et moribus comprobavit. Quod quam magnum sit fictae veterum fabulae declarant, in quibus hoc primum est in voluptate. Neque enim disputari.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-06-26 08:39:22',71,63,558.22,5,'Ita prorsus existimo, neque eum Torquatum, qui hoc primus cognomen invenerit, aut torquem illum hosti detraxisse, ut aliquam ex eo perciperet corpore voluptatem, aut cum Latinis tertio consulatu.','Atomorum inter se, ex quo efficiantur ea, quae dixi, sole ipso illustriora et clariora sunt, si omnia dixi hausta e fonte naturae, si tota oratio nostra.','Gratia. Sed de clarorum hominum factis illustribus et gloriosis satis hoc loco dictum sit. Erit enim iam de omnium virtutum cursu ad voluptatem proprius.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-06-21 07:44:16',72,53,549.03,4,'Atque nostra et pariter dolemus angoribus. Quocirca eodem modo sapiens erit affectus erga amicum, quo in se ipsum, quosque labores.','Sequitur Democritum, non fere labitur. Quamquam utriusque cum multa non probo, tum illud in primis, quod, cum in rerum natura duo quaerenda sint, unum, quae materia sit.','Vis et natura orationis et consequentium repugnantiumve ratio potest perspici. Omnium autem rerum natura duo quaerenda sint, unum.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-11-26 02:18:44',73,45,376.19,1,'Labores magnosque susceperant. Ecce autem alii minuti et angusti aut omnia semper desperantes aut malivoli, invidi, difficiles, lucifugi, maledici, monstruosi, alii autem etiam amaret.','Quaedam nos natura genuit et conformavit, ut mihi quidem depravare videatur. Ille atomos quas appellat, id est vel summum bonorum vel ultimum vel extremum -- quod Graeci telos nominant --, quod ipsum nullam ad aliam rem, ad id autem.','Quoniam, cum privamur dolore, ipsa liberatione et vacuitate omnis molestiae gaudemus, omne autem id, quo gaudemus, voluptas est.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-10-25 05:10:19',74,55,503.96,4,'Doloribus, etiamsi voluptas ea, quae dices, libenter assentiar. Probabo, inquit.','Negant posse a voluptate discedere. Nam cum ignoratione rerum bonarum et malarum maxime hominum vita vexetur, ob eumque errorem et voluptatibus maximis saepe priventur et durissimis animi doloribus torqueantur, sapientia est adhibenda, quae et splendide dicta sint neque sint conversa de Graecis? Nam si dicent ab illis has res esse tractatas, ne.','Qui me ad alias litteras vocent, genus hoc scribendi, etsi sit elegans, personae tamen et dignitatis esse negent. Contra quos omnis dicendum breviter existimo. Quamquam philosophiae quidem vituperatoribus satis responsum est eo libro, quo a populo.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2023-12-05 06:04:25',75,88,459.93,2,'Istae enim vestrae eximiae pulchraeque virtutes nisi voluptatem efficerent, quis eas aut laudabilis aut expetendas arbitraretur? Ut enim virtutes, de quibus.','Idem licet transferre in voluptatem, ut postea variari voluptas distinguique possit, augeri amplificarique non possit. At etiam Athenis, ut e.','Involuta aperiri, altera prompta et aperta iudicari. Etenim quoniam detractis de homine sensibus reliqui.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-11-25 09:23:30',76,79,566.76,2,'Pervenias profectus a Theseo. At.','Inpendente, quem tandem hoc statu praestabiliorem aut magis expetendum possimus dicere? Inesse enim necesse est aut fastidii delicatissimi. Mihi quidem videtur. Ac fieri potest, ut propemodum iustioribus utamur illis, qui omnino avocent a philosophia, quam his, qui rebus infinitis modum constituant in reque eo meliore, quo maior sit, si nihil efficeret; nunc.','Persequeretur, vivendi artem tantam tamque et operosam et perinde fructuosam relinqueret? Non ergo Epicurus ineruditus, sed ii indocti, qui, quae pueros non didicisse turpe.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-03-27 14:19:55',77,6,389.56,2,'Efficit voluptatis. Itaque non placuit Epicuro medium esse quiddam inter.','Nemini e nostris, qui haec subtilius velint tradere.','Paratus est, ut meminerit maximos.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-04-08 21:29:39',78,60,597.64,1,'Tu quidem oderis, ut fere faciunt, qui ab eo dissentiunt, sed certe non probes, eum quem ego arbitror unum vidisse verum maximisque erroribus animos hominum liberavisse et omnia tradidisse, quae pertinerent ad bene beateque vivendo a Platone disputata sunt.','Homine omni doctrina erudito, defensa est Epicuri sententia de voluptate, nihil scilicet novi, ea tamen, quae te ipsum probaturum esse confidam. Certe, inquam, pertinax non ero tibique, si mihi probabis ea, quae voluptaria, delicata, mollis habeatur disciplina, quam gravis, quam.','Discordia dominorum domus; quo minus omnes mea legant. Utinam esset ille Persius, Scipio vero et Rutilius multo etiam magis, quod, cuius in mente consedit, hoc ipso, quod adest, turbulenta est; si vero molita quippiam est, quamvis.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-05-10 22:03:38',79,46,460.95,5,'Quaerenda sint, unum, quae materia sit, ex qua quaeque res efficiatur, alterum.','Turma omnis chorusque: ''chaere, Tite!'' hinc.','Error omnis imperitorum intellegaturque ea, quae voluptaria, delicata, mollis habeatur disciplina, quam gravis, quam continens, quam severa sit. Non enim hanc solam sequimur, quae suavitate aliqua naturam ipsam.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-03-26 23:30:48',80,49,443.46,1,'Et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi.','Etiam sapientia est; sive hoc difficile est, tamen nec modus est neque honoris neque imperii nec.','Quae cum dixisset, Explicavi, inquit, sententiam meam, et eo quidem consilio, tuum iudicium ut cognoscerem, quoniam mihi ea facultas, ut id apte fieri possit, ut ab ipsis, qui eam disciplinam probant, non soleat accuratius explicari; verum enim invenire volumus, non tamquam adversarium aliquem convincere. Accurate autem quondam a.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-03-01 02:03:01',41,56,456.27,5,'Elaboraret, et sunt illius scripta leviora.','Suum iudicium retinent, ne voluptate victi faciant id, quod his libris quaeritur, qui sit finis, quid extremum, quid ultimum, quo sint omnia bene vivendi recteque faciendi consilia referenda, quid sequatur natura ut summum ex rebus expetendis, quid fugiat ut extremum malorum? Qua de re cum sit inter doctissimos summa dissensio, quis alienum putet eius esse dignitatis.','Utinam esset ille Persius, Scipio vero et Rutilius multo etiam magis, quod, cuius in animo versatur, numquam sinit eum respirare, numquam adquiescere. Quodsi ne.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-10-13 18:41:59',42,74,552.97,3,'Voluptate, quid eo miserius dici aut fingi potest? Quodsi vita doloribus referta maxime fugienda.','Hostem impetum fecisse aut in voluptate esse aut in armatum hostem impetum fecisse aut in armatum hostem impetum fecisse aut in dolore, sed in his rebus peccant, cum e quibus haec efficiantur ignorant. Animi autem voluptates et dolores animi quam corporis. Nam corpore nihil nisi praesens et quod quaeritur saepe, cur tam.','Et vita sine amicis insidiarum et metus et aegritudines ad dolorem referuntur, nec praeterea est res ulla, quae sua natura aut sollicitare possit aut angere. Praeterea et appetendi et refugiendi et omnino rerum gerendarum initia proficiscuntur aut a dolore. Quod cum ita esset affecta, secundum non recte, si voluptas esset bonum, desideraret.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-02-08 07:58:25',43,53,447.40,3,'Nostro frequenter audivi, cum miraretur ille quidem utrumque, Phaedrum autem etiam amatoriis levitatibus dediti, alii petulantes, alii audaces, protervi, idem intemperantes et ignavi, numquam in sententia.','Eiusmod tempor incididunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim medicorum scientiam non ipsius artis.','Amicitiae non modo singulos homines, sed universas familias evertunt, totam etiam labefactant saepe rem publicam. Ex cupiditatibus odia, discidia, discordiae, seditiones, bella nascuntur, nec eae se foris solum iactant nec.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-04-23 12:28:01',44,63,507.58,4,'Cernimus, id omne oritur a sensibus; qui si omnes.','Quam ostendis. Sed uti oratione perpetua malo quam interrogare aut interrogari. Ut placet, inquam. Tum dicere exorsus est. Primum igitur, inquit, sic agam, ut.','Voluptatis et liberae potest. Atqui pugnantibus et contrariis studiis consiliisque semper utens nihil quieti videre.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2023-12-10 06:55:36',45,81,556.42,3,'Iste vester plane, ut mihi quidem videtur, inermis ac nudus est. Tollit definitiones, nihil de dividendo ac partiendo docet, non quo modo efficiatur concludaturque ratio tradit, non qua via captiosa solvantur ambigua distinguantur ostendit; iudicia rerum dirigentur, numquam ullius oratione victi sententia desistemus. Nisi autem rerum natura duo quaerenda sint, unum, quae materia sit, ex qua.','Omni munere vitae optimum et verissimum sit, exquirere? An, partus ancillae sitne in fructu.','Suscipit, ut non plus habeat sapiens, quod gaudeat, quam quod angatur. Optime vero Epicurus, quod exiguam dixit fortunam intervenire sapienti maximasque ab eo delectari, quod ista Platonis, Aristoteli, Theophrasti orationis.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-05-14 17:14:19',46,35,595.04,2,'Ait enim declinare atomum sine causa; quo nihil posset.','Oculis quidem exercitus. -- Quid ex eo est consecutus? -- Laudem et caritatem, quae sunt vitae sine metu vivere. Quae est enim in vita tantopere quaerendum quam cum omnia in philosophia, tum id.','Torquentur, sapientes bona praeterita grata recordatione renovata delectant. Est autem situm in nobis ut.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-06-27 08:00:37',47,3,624.27,3,'Individua et solida corpora ferri deorsum suo pondere ad lineam, hunc naturalem esse omnium corporum motum. Deinde ibidem homo acutus, cum illud ocurreret, si omnia dixi hausta e fonte naturae, si tota oratio nostra omnem sibi fidem sensibus confirmat, id est voluptatem. Homines optimi non intellegunt totam rationem everti, si ita res se habeat. Nam si.','Fabulis delectari dicat, Latinas litteras oderit? Synephebos ego, inquit, potius Caecilii aut Andriam Terentii quam utramque Menandri legam? A quibus tantum dissentio, ut, cum.','In voluptatis locum dolor forte successerit, at contra gaudere nosmet omittendis doloribus, etiamsi voluptas ea, quae senserit ille, tibi non vera videantur. Vide, quantum, inquam, fallare, Torquate. Oratio me istius philosophi non offendit; nam et ipsa.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-08-31 23:32:02',48,62,591.15,3,'Verterunt nostri poetae fabulas, male, credo, mererer de meis civibus, si ad eorum cognitionem divina illa ingenia transferrem. Sed id neque feci adhuc nec mihi illud dixeris: ''Haec enim ipsa mihi sunt voluptati, et erant illa.','Benivolentiam sibi conciliant et, quod aptissimum est ad quiete vivendum, caritatem, praesertim cum omnino nulla sit utilitas ex amicitia, tamen ipsi amici propter se.','Est, quae non modo non inopem, ut vulgo putarent, sed locupletiorem etiam esse quam vacare omni dolore careret, non modo non inopem, ut vulgo putarent, sed locupletiorem etiam esse quam vacare omni dolore et molestia perfruique.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-06-17 21:03:10',49,67,620.34,4,'Se dicant in Graecis legendis operam malle consumere. Postremo aliquos futuros suspicor, qui me ad alias litteras vocent, genus hoc scribendi, etsi sit elegans, personae tamen et dignitatis esse negent. Contra quos omnis dicendum breviter existimo. Quamquam philosophiae quidem vituperatoribus satis responsum est eo.','Hic noster labor in varias reprehensiones incurreret. Nam quibusdam, et iis servire, qui vel utrisque litteris uti velint vel, si suas habent, illas non magnopere desiderent. Qui autem.','Corrupte, nonne ei maximam gratiam habere debemus, qui hac exaudita quasi voce naturae sic eam firme graviterque comprehenderit, ut omnes bene sanos in viam placatae, tranquillae, quietae, beatae vitae dicta.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-01-20 21:33:09',50,55,459.15,3,'Cupiditate non provident, similique sunt in eadem causa sunt, qua ante quam nati, et ad.','Quid malum, sensu iudicari, sed animo etiam ac ratione intellegi posse et voluptatem ipsam.','Gaudemus, omne autem id, quo gaudemus, voluptas est, ut omne, quo offendimur, dolor.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2023-12-08 22:56:03',52,72,618.58,4,'Comparandae voluptatis -- Quam autem ego dicam voluptatem, iam videtis, ne invidia verbi labefactetur oratio mea --. Nam cum ignoratione rerum bonarum et malarum maxime hominum vita vexetur, ob eumque errorem et voluptatibus maximis saepe priventur et durissimis animi doloribus torqueantur, sapientia.','Assumenda est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet, ut et adversa quasi perpetua oblivione obruamus et secunda iucunde ac suaviter meminerimus. Sed cum ea, quae sensum moveat, nulla successerit, eoque.','Deinde hoc quoque alienum; nam ante Aristippus, et ille melius. Addidisti ad extremum etiam indoctum fuisse. Fieri, inquam, Triari, nullo pacto.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-02-03 22:45:58',51,87,445.40,3,'Disserendum et rationibus conquisitis de voluptate et dolore magna aliqua. Ut enim ad minim veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquip ex.','Magis expetendum possimus dicere? Inesse enim necesse est effici, ut sapiens solum amputata circumcisaque inanitate omni et errore naturae finibus contentus.','Me istius philosophi non offendit; nam et praeterita.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-07-15 10:54:05',52,44,597.51,5,'Et negent satis esse, quid bonum sit aut quid iudicat, quo aut petat aut fugiat aliquid, praeter voluptatem et dolorem. Ad haec et quae vel aliter pararetur et.','Erant, ad quorum iudicium elaboraret, et sunt illius.','Et perpetuam iucunditatem vitae tenere possumus neque vero ipsam amicitiam tueri, nisi aeque amicos et.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-09-03 13:10:18',53,47,428.94,4,'Iustitiam, aequitatem, fidem, neque homini infanti aut inpotenti iniuste facta conducunt, qui nec facile.','Natura perspecta erit, nullo modo poterimus sensuum.','Et potione fames sitisque depulsa est, ipsa detractio molestiae consecutionem affert voluptatis, sic in omni munere vitae optimum et verissimum sit, exquirere? An, partus ancillae sitne in fructu habendus, disseretur inter principes civitatis, P. Scaevolam M''.que.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-09-25 18:19:55',54,59,554.97,2,'Sed ut omittam pericula, labores, dolorem etiam, quem optimus quisque pro patria et pro suis.','Quem ego arbitror unum vidisse verum maximisque erroribus animos hominum liberavisse et omnia tradidisse.','Tantum satis esse admonere. Interesse enim inter argumentum conclusionemque rationis et inter mediocrem animadversionem atque admonitionem.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-06-02 12:45:56',55,24,408.25,1,'Haec, quae vitam omnem perturbari videmus errore et inscientia.','Perpessio dolorum per se ipsa allicit nec patientia nec assiduitas nec vigiliae nec ea ipsa, quae tibi probarentur; si qua.','Legum odioque civium? Et tamen in quibusdam neque pecuniae modus est ullus investigandi veri, nisi inveneris, et quaerendi defatigatio turpis est, cum id, quod sentiant non esse faciendum, ii voluptatem maximam adipiscuntur praetermittenda voluptate. Idem etiam dolorem saepe perpetiuntur, ne, si amicitiam propter nostram voluptatem expetendam putemus, tota.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-03-31 13:28:59',56,23,495.03,5,'In sensibus ponit, quibus si semel aliquid falsi pro vero probatum sit, sublatum esse omne iudicium veri et falsi putat. Confirmat autem illud vel maxime, quod ipsa natura, ut ait ille, sciscat et probet, id est voluptatem et dolorem.','Sapientia, quae ars vivendi putanda est, non expeteretur, si nihil efficeret; nunc expetitur, quod.','Perspiciatis, unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam eaque ipsa, quae laudatur.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-06-11 02:57:40',57,41,428.78,5,'Contenta posset nec ulla pars vacuitate doloris sine iucundo motu voluptatis. Sin autem summa.','Doloribus eosque humili animo inbecilloque ferre miserum est, ob eamque debilitatem animi multi parentes, multi amicos, non nulli patriam, plerique autem se ipsos penitus perdiderunt, sic robustus animus.','Legantur? Quamquam, si plane sic verterem Platonem aut Aristotelem, ut verterunt nostri poetae fabulas, male, credo, mererer de meis civibus, si ad eorum cognitionem divina illa ingenia.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-04-24 07:28:29',58,62,547.53,2,'In primis gravis et doctus adolescens, ei disputationi interesset. Nam cum ad me de.','Maximi cadere possunt, nulla spe proposita fore levius aliquando, nulla praeterea neque praesenti nec expectata voluptate, quid eo miserius dici aut fingi potest? Quodsi vita doloribus referta maxime fugienda est, summum profecto malum est vivere cum dolore, cui sententiae consentaneum.','Disserunt. Praeterea sublata cognitione et scientia.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-07-12 16:23:31',59,46,593.28,2,'Quidem locis pluribus. Sed quot homines, tot sententiae; falli igitur possumus. Quam ob rem tandem, inquit, non satisfacit? Te enim iudicem aequum puto, modo quae dicat ille bene noris. Nisi mihi Phaedrum, inquam, tu mentitum aut Zenonem putas, quorum utrumque audivi, cum miraretur ille.','Ut aut reiciendis voluptatibus maiores alias consequatur aut perferendis doloribus asperiores repellat. Hanc ego cum teneam sententiam, quid est cur dubitemus dicere et sapientiam.','Est voluptas. Ut enim, cum cibo et potione fames sitisque depulsa est, ipsa detractio molestiae consecutionem affert voluptatis, sic in omni re doloris amotio successionem efficit voluptatis. Itaque non placuit Epicuro medium esse quiddam inter dolorem et voluptatem; illud enim ipsum, quod quibusdam medium.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-02-26 15:17:33',60,24,555.74,5,'Voluptatis locum dolor forte successerit, at contra gaudere nosmet omittendis doloribus, etiamsi voluptas.','Minus id, quod his libris quaeritur, qui sit finis, quid extremum, quid ultimum, quo sint omnia.','Aut perferendis doloribus asperiores repellat. Hanc ego cum teneam sententiam, quid est cur tam multi sint Epicurei, sunt aliae quoque.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-02-06 13:16:55',61,36,613.85,1,'Diligant. Quod et scripta multa sunt, sic inprobitas si cuius in mente consedit, hoc ipso, quod adest, turbulenta est; si vero molita quippiam est, quamvis occulte fecerit, numquam.','Magnitudinem celeritas, diuturnitatem allevatio consoletur. Ad ea cum accedit, ut neque divinum numen horreat nec praeteritas voluptates effluere patiatur earumque assidua recordatione laetetur, quid est, cur nostri a nostris non legantur? Quamquam, si plane sic verterem Platonem aut Aristotelem, ut verterunt nostri poetae fabulas, male, credo, mererer de meis civibus, si ad.','Sit causa peccandi. Quae enim cupiditates a natura proficiscuntur, facile explentur sine ulla iniuria, quae autem de bene beateque vivendo a Platone disputata sunt, haec explicari non placebit Latine? Quid? Si nos non interpretum fungimur munere, sed tuemur ea, quae dices, libenter assentiar. Probabo, inquit, modo ista sis aequitate, quam ostendis. Sed uti oratione perpetua malo.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-04-14 13:19:47',62,49,465.78,3,'Graeco sermone tractavissent, ea Latinis litteris mandaremus, fore ut hic noster labor in varias reprehensiones incurreret. Nam quibusdam, et iis.','Facilius id, quod propositum est, summum bonum consequamur? Clamat Epicurus, is quem vos nimis voluptatibus esse deditum dicitis; non posse iucunde vivi, nisi sapienter, honeste iusteque vivatur, nec sapienter, honeste, iuste, nisi iucunde. Neque enim civitas in seditione beata.','Fugienda est, summum profecto malum est vivere cum dolore, cui sententiae.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-09-26 14:04:20',64,48,515.26,5,'Quae sua natura aut sollicitare possit aut angere. Praeterea et appetendi et refugiendi et omnino rerum gerendarum initia proficiscuntur aut a voluptate discedere. Nam.','Qui blanditiis praesentium voluptatum deleniti atque corrupti, quos dolores.','Autem explicabo, voluptas ipsa quae.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-05-22 06:17:43',65,75,393.78,1,'Officii partem, ad ea, quae dixi, sole ipso illustriora et clariora sunt, si omnia dixi hausta e fonte naturae, si.','De re cum sit inter doctissimos summa dissensio, quis alienum putet eius esse dignitatis, quam mihi quisque tribuat, quid in omni re doloris amotio successionem efficit voluptatis. Itaque non placuit Epicuro medium.','Malum, quae perspexit in hoc ipso vitae spatio amicitiae praesidium esse firmissimum.'' Sunt autem quidam e nostris, qui haec subtilius velint tradere et negent.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-02-15 04:25:14',63,65,433.75,5,'Ut id apte fieri possit, ut ab ipsis, qui eam disciplinam probant, non soleat accuratius explicari; verum enim invenire volumus, non tamquam adversarium aliquem convincere. Accurate autem.','Disputationi interesset. Nam cum ad me de virtute misisti. Sed ex eo credo quibusdam usu venire; ut abhorreant a Latinis, quod inciderint in inculta quaedam et horrida, de malis Graecis Latine scripta deterius. Quibus ego assentior.','In gravitate brevis soleat esse, ut ad Orestem pervenias.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-09-01 05:53:09',64,100,455.86,2,'Eam disciplinam probant, non soleat accuratius explicari; verum enim invenire volumus, non tamquam adversarium aliquem convincere. Accurate autem quondam a L. Torquato, homine omni doctrina erudito, defensa est Epicuri sententia de voluptate, a meque ei responsum, cum C. Triarius, in primis gravis et doctus adolescens, ei disputationi interesset. Nam cum ad me in Cumanum salutandi causa.','Scientiam non ipsius artis, sed bonae valetudinis causa probamus, et gubernatoris ars, quia.','De physicis alias, et quidem locis pluribus. Sed quot homines, tot sententiae; falli igitur possumus. Quam ob rem tandem, inquit, non satisfacit? Te enim.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-06-18 05:27:05',65,40,482.72,2,'Voluptatem efficerent, quis eas aut laudabilis aut expetendas arbitraretur? Ut enim aeque doleamus.','Idem Lucilius, apud quem praeclare Scaevola: Graecum te, Albuci, quam Romanum atque.','Et vituperata ab Hortensio. Qui liber cum et tibi probatus videretur et iis, quos modo nominavi, cum inciderit, ut id meo arbitratu facerem, ante hoc tempus numquam est neque perpessio dolorum per se ipsam causam non.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-07-08 03:41:30',66,36,580.12,5,'Poenis obligantur. Qui autem alia malunt scribi a nobis, aequi esse debent, quod et acutum genus est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio, cumque nihil impedit, quo minus id, quod quaeritur, sit pulcherrimum. Etenim.','Eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad sapientiam perveniri potest, non paranda nobis solum ea, sed fruenda etiam sapientia est; sive hoc difficile est, tamen nec modus ullus nec finis inveniri potest. Quodsi vitam omnem perturbari videmus errore et inscientia, sapientiamque esse solam.','Voluptatem. Quisquis enim sentit, quem ad modum, quaeso, interpretaris? Sicine eos censes aut in dolore. Omnis autem privatione doloris putat Epicurus terminari.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-02-29 16:47:11',67,36,470.13,4,'Meo doctiores cives mei, nec cum.','Electram, tamen male conversam Atilii mihi legendam putem, de quo Lucilius: ''ferreum.','Liber cum et tibi probatus videretur et iis, quos modo nominavi, cum Attico nostro frequenter audivi.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-01-17 18:38:07',68,79,527.47,4,'Esset et virtus et cognitio rerum, quod minime ille vult expetenda. Haec igitur Epicuri non probo, tum illud in primis, quod, cum in rerum natura cognita levamur superstitione, liberamur mortis metu, non conturbamur ignoratione rerum, e qua ipsa horribiles existunt.','Et dicit plane, quod intellegam; et tamen ego.','A falso distinctio traditur. Restat locus huic disputationi vel.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-06-15 06:18:51',69,72,411.62,5,'Expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio, cumque nihil impedit, quo minus id, quod maxime placeat, facere possimus.','Effici, ut sapiens solum amputata circumcisaque inanitate omni.','Illae Epicuri propriae ruinae: censet enim eadem illa constituto veri a falso distinctio traditur. Restat locus huic disputationi vel maxime necessarius de amicitia, quam.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-04-28 23:15:10',70,78,596.24,2,'Comprobavit. Quod quam magnum sit.','Ducimus, qui blanditiis praesentium voluptatum deleniti atque corrupti, quos dolores et quas molestias excepturi sint, obcaecati cupiditate non provident, similique.','Habeo quae velim. An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? Utrum igitur percurri omnem Epicuri disciplinam placet an de una.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-07-30 06:02:55',71,47,413.52,4,'Ipsas tam expetendas, quam nostras expeteremus, quo loco videtur quibusdam stabilitas amicitiae vacillare, tuentur tamen eum locum seque.','Quod huc possit, quod melius sit, accedere?','Maxime necessarius de amicitia, quam, si voluptas esset bonum, desideraret.'' -- Ita credo. -- ''Non est igitur voluptas bonum.'' Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. Conclusum est enim in vita tantopere quaerendum quam cum omnia in philosophia, tum id, quod his libris quaeritur, qui.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-09-30 21:23:44',72,36,578.89,3,'Verum etiam summam voluptatem. Quisquis enim sentit, quem ad modum eae semper voluptatibus inhaererent, eadem de amicitia dicenda sunt. Praeclare enim Epicurus his paene verbis: ''Eadem'', inquit, ''scientia confirmavit animum, ne quod aut sempiternum aut diuturnum timeret malum, quae perspexit in hoc ipso vitae spatio amicitiae praesidium esse firmissimum.'' Sunt autem quidam.','E corpore et ad dolores ita paratus est, ut omne, quo offendimur, dolor.','Qui, quae pueros non didicisse turpe est, ea putant usque ad senectutem esse discenda. Quae cum dixissem, magis ut illum provocarem quam ut ipse loquerer, tum Triarius leniter arridens: Tu quidem, inquit, totum Epicurum paene e.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2023-12-26 21:04:24',73,21,574.02,5,'Sentiri haec putat, ut calere ignem, nivem esse albam, dulce mel. Quorum nihil oportere exquisitis rationibus confirmare, tantum satis esse admonere. Interesse enim inter argumentum conclusionemque rationis et inter mediocrem animadversionem atque admonitionem. Altera occulta quaedam.','Etiam Democritus haeret, turbulenta concursio hunc mundi ornatum efficere non poterit. Ne illud quidem perspicuum est, maximam animi aut voluptatem aut molestiam plus aut ad beatam aut ad beatam aut ad miseram vitam afferre momenti quam eorum utrumvis, si aeque diu sit in corpore.','Mnesarchum, Panaetium, multos alios in primisque familiarem nostrum Posidonium. Quid? Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Quid? Epicurei num desistunt.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-07-18 21:36:13',74,97,377.02,3,'In philosophia, tum id, quod maxime placeat, facere possimus, omnis voluptas assumenda est, omnis dolor.','Istae enim vestrae eximiae pulchraeque virtutes nisi voluptatem efficerent, quis eas aut laudabilis aut expetendas arbitraretur? Ut enim virtutes, de quibus ante dictum est, sic amicitiam negant posse a voluptate.','Et alliciat suapte natura, non potest esse dubium, quin id sit summum atque extremum bonorum omnium, beateque vivere nihil aliud sit nisi cum voluptate conectitur. Nam et ipsa declinatio ad libidinem fingitur.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-07-15 14:02:12',75,9,378.96,4,'Quo maior sit, mediocritatem desiderent. Sive enim ad sapientiam perveniri potest, non.','Ipsam optabilem, sed quia non numquam eius modi esse iudico, ut nihil homine videatur indignius. Ad maiora enim quaedam nos natura genuit et conformavit, ut mihi videtur, expediunt. Ut enim.','Est ultimum esse bonorum voluptatem ex infinito tempore aetatis percipi posse, quam ex hoc facillime perspici potest: Constituamus aliquem magnis, multis, perpetuis fruentem et animo et.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-07-18 18:43:05',76,93,518.57,1,'Quid? Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Quid? Epicurei num desistunt de isdem, de quibus neque depravate iudicant neque corrupte, nonne ei maximam gratiam habere debemus, qui hac exaudita quasi voce naturae sic eam firme graviterque comprehenderit, ut.','Isti curiosi, quos offendit noster minime nobis iniucundus labor. Iis igitur est non miser. Accedit etiam mors, quae quasi delapsa.','Attingere itaque ** attulit rem commenticiam: declinare dixit atomum perpaulum, quo nihil turpius physico, quam fieri quicquam sine causa dicere, -- et illum motum naturalem omnium ponderum, ut ipse loquerer, tum Triarius leniter arridens: Tu quidem, inquit, totum Epicurum paene e philosophorum choro sustulisti. Quid ei reliquisti, nisi.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-01-08 19:29:18',77,10,593.46,1,'L. Torquato, homine omni doctrina erudito, defensa est Epicuri sententia de voluptate, a meque ei responsum, cum C. Triarius, in primis gravis et doctus adolescens, ei disputationi interesset. Nam cum ad me accedis.','Flagitem. Re mihi non aeque satisfacit, et quidem tibi et declinationem istam atomorum et magnitudinem solis probabo et Democriti errata ab Epicuro reprehensa et correcta permulta. Nunc dicam.','Vivendum aptior partitio quam illa, qua est usus Epicurus? Qui unum genus posuit earum cupiditatum, quae essent et naturales et necessariae, alterum, quae vis.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-01-22 21:04:02',78,27,389.88,3,'Illaberetur, nec manus esse contenta posset nec ulla pars vacuitate doloris sine iucundo motu voluptatis. Sin autem summa voluptas est.','Est. Extremum autem esse bonorum eum voluptate vivere. Huic certae stabilique sententiae.','Etiam oportet in eo, qui ita sit affectus, eum necesse est in voluptate aut.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2023-12-22 15:40:50',79,10,550.74,4,'Defenditur, tamen eius modi tempora incidunt, ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquip ex ea commodi consequatur? Quis autem vel eum iure reprehenderit, qui in ea voluptate velit esse, quam.','Philosophia, quam his, qui rebus infinitis modum constituant in reque eo meliore, quo maior sit, si nihil tale metuamus. Iam illud quidem physici, credere aliquid esse minimum, quod profecto numquam putavisset, si a Polyaeno, familiari suo, geometrica discere maluisset quam illum etiam ipsum dedocere. Sol Democrito magnus videtur, quippe homini erudito in geometriaque perfecto, huic pedalis.','Bonum esse vult, summumque malum dolorem, idque instituit docere sic: Omne animal, simul atque natum sit, voluptatem appetere eaque gaudere ut summo bono, dolorem aspernari ut summum malum et, quantum possit, a se.');
INSERT INTO Review(createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart) VALUES ('2024-07-11 05:00:27',80,92,399.67,4,'Posset. Conclusum est enim in vita tantopere quaerendum quam cum omnia in philosophia.','Est in Ceramico Chrysippi sedentis porrecta.','Vacuitate doloris sine iucundo motu voluptatis. Sin autem summa voluptas est, ut Epicuro placet, nihil.');
