INSERT INTO Announcement(announcementId,createdBy,announcementText) VALUES (34,100,'Recte, quae oblique ferantur, deinde eadem illa individua et solida corpora ferri deorsum suo pondere ad lineam, hunc naturalem esse omnium corporum motum. Deinde ibidem homo acutus, cum illud ocurreret, si omnia dixi hausta e fonte naturae, si tota oratio nostra omnem sibi fidem sensibus confirmat, id est incorruptis atque integris testibus.');
